void updateSampleRate(int soundNum){
	int sample = sounds[soundNum].currentSample;
	switch(sample){
	case 8000:
		sample = AC97_PCM_RATE_8000_HZ;
			break;
	case 11025:
		sample = AC97_PCM_RATE_11025_HZ;
			break;
	case 16000:
		sample = AC97_PCM_RATE_16000_HZ;
			break;
	case 22050:
		sample = AC97_PCM_RATE_22050_HZ;
			break;
	case 44100:
		sample = AC97_PCM_RATE_44100_HZ;
			break;
	case 48000:
		sample = AC97_PCM_RATE_48000_HZ;
			break;
	default:
		sample = AC97_PCM_RATE_11025_HZ;
		break;
	}
	XAC97_WriteReg(XPAR_AXI_AC97_0_BASEADDR, AC97_PCM_DAC_Rate, sample);
}

int getActive(int soundNum){
	return sounds[soundNum].active;
}

void setActive(int soundNum, int active){
	sounds[soundNum].active = active;
}

int getSampleRate(int soundNum){
	return sounds[soundNum].sampleRate;
}

int getCurrentSampleNum(int soundNum){
	return sounds[soundNum].currentSample;
}

void setCurrentSampleNum(int soundNum, int sample){
	sounds[soundNum].currentSample = sample;
}

int getSize(int soundNum){
	return sounds[soundNum].size;
}

int* getArrayAddress(int soundNum){
	return sounds[soundNum].arrayAddress;
}

void deactivateOthers(int soundNum){
	int i;
	for(i = 0; i < soundNum; i++){
		setActive(soundNum, 0);
	}
}

int getCurrentSample(int soundNum){
	int sample;
	if(getActive(soundNum)){
		int* sound = getArrayAddress(soundNum);
		int currentSampleNum = getCurrentSampleNum(soundNum);
		sample = sound[currentSampleNum];
		currentSampleNum++;
		if(currentSampleNum >= getSize(soundNum)){
			setActive(soundNum, INACTIVE);
			currentSampleNum = 0;
		}
		setCurrentSampleNum(soundNum,currentSampleNum);
	}
	else{
		sample = 0;
	}
	return sample;
}

int getTotalActive(){
	int num = 0;
	int soundNum;
	for(soundNum = 0; soundNum < SOUND_NUM; soundNum++){
		if(getActive(soundNum)){
			num++;
		}
	}
	return num;
}
